import {
    RouterProvider,
    createBrowserRouter,
    createRoutesFromElements,
    Route,
    Link
  } from "react-router-dom";

  <Router>
        <div>
          <Route exact path="/" component={Login}/>
          <Route path="/cashier-pos" component={CashierPOS}/>
          <Route path="/customer-pos" component={CustomerPOS}/>
          <Route path="/dispatch-counter" component={DispatchCounter}/>
          <Route path="/kitchen-kds-1" component={KitchenKDS1}/>
          <Route path="/kitchen-kds-2" component={KitchenKDS2}/>
          <Route path="/kitchen-kds-3" component={KitchenKDS3}/>
          <Route path="/manager-360-view" component={Manager360View}/>
          <Route path="/order-status-dining-display-tv" component={OrderStatusDiningDisplayTV}/>
          <Route path="/order-status-kitchen-display-tv" component={OrderStatusKitchenDisplayTV}/>
          <Route exact path="/login" component={Login}/>
          <Route component={Login}/>
        </div>
      </Router>


  const router = createBrowserRouter(createRoutesFromElements(
    <Route path="/" element={<Layout />}>
      <Route index element={<Home />} />
      <Route path="about" element={<About />} />
      <Route
        path="login"
        element={<Login />}
        action={loginAction}
      />
      <Route
        path="vans"
        element={<Vans />}
        errorElement={<Error />}
        loader={vansLoader}
      />
      <Route
        path="vans/:id"
        element={<VanDetail />}
        errorElement={<Error />}
        loader={vanDetailLoader}
      />

      <Route element={<AuthRequired />}>
        <Route path="host" element={<HostLayout />} >
          <Route
            index
            element={<Dashboard />}
            errorElement={<Error />}
            loader={dashboardLoader}
          />
          <Route path="income" element={<Income />} />
          <Route path="reviews" element={<Reviews />} />
          <Route
            path="vans"
            element={<HostVans />}
            errorElement={<Error />}
            loader={hostVansLoader}
          />
          <Route
            path="vans/:id"
            element={<HostVanDetail />}
            errorElement={<Error />}
            loader={hostVansDetailLoader}
          >
            <Route index element={<HostVanInfo />} />
            <Route path="pricing" element={<HostVanPricing />} />
            <Route path="photos" element={<HostVanPhotos />} />
          </Route>
        </Route>
      </Route>
      <Route path="*" element={<NotFound />} />
    </Route>
  ))

  export default router;
